	"TBAppDescription": "43 Million caps\nCan you survive in the world destroyed after a nuclear war? With radiation, hunger and diseases around you. You have to cross the whole country and save your family. Who knows if they are alive, or maybe radiation and deadly virus have already reached them? Reveal a secret of the apocalypse and get your memories back during a journey across the huge territory of the USSR in the 80th. \n\nIt is not easy to survive after apocalypse. You'll face the real hungry games! Monsters, zombie, thirst, uncountable diseases and injuries, blood-thirsty enemies \u2013 you have to fight it all. Craft all your resources: weapons, clothes, means of transport. \n\n- Hardcore survival:\nHunger, zombie and radiation won't give you a chance to relax.\n\n- Realistic world:\nThe turn of the seasons, huge map of USSR and more than 2500 different towns and cities. Hunt animals, but be careful: even rats can injure you seriously! Explore the wilderness!\n\n- A lot of opportunities:\nMulticraft, obtaining skills, hundreds of crafting schemes, a lot of ammunition.\n\n- People and stories:\nInteresting quests and helpful allies. An open game world.\n\n- Improve your skills:\nMechanics, medicine, chemistry and many others.\n\n- Cooperative mode:\nThe Online mode  with a chat room, exchange of items and united fightings. Multiplayer survival game.\n\nBenefits of Premium version: \n- 2500 caps every game\n- save in any place \n- chat without any limitations \n- sending parcels without any limitations \n- access to all kinds and colors of map markers.\n\nSurvive in post-nuclear USSR: defeat diseases, hunger and enemies! Play Online also! Survive with other players together.\n\nExplore the abandoned houses and shelters. Find weapon and build transport using various materials.\nRemember everything you learnt on chemistry and physics! It is the most realistic surviving game! \n\nFeatures: \n- \u0421raft system \u2013 get resources, hunt, find useful objects or weapon and create your own one! \n- Hardcore simulator of survival \n- Journey across the wilderness map in the multiplayer mode \n- Choose the difficulty mode: sandbox, real life or online\nWar never changes. In 1985 USSR went down before an unknown enemy. In a few days the entire country became a radioactive wasteland - violence, hunger and diseases reign here now. When you no longer loose in the fight with the death, the other survivors wait for you in the cooperative - the Online mode let you survive together dealing with difficulties, talking in the chat room and sending gifts to each other.\n\nLicense agreement: https:\/\/dayrtech.ru\/conditions\/en\/",
