	"TBAppDescription": "900 Million Coins & 900 Million Beans\nThe evil wizard Gargamel and his ever present cat companion, Azrael, have finally found the Smurfs\u2019 village and have scattered our lovable blue friends far and wide throughout the enchanted forest. Come along with familiar friends, like Papa Smurf, Smurfette, Brainy, Jokey, Greedy and the rest of the smurf family, as they guide you on a family fun adventure to build a new forest village for the Smurfs to call home.\n\nBased on the beloved classic Saturday morning cartoon, your adventure begins with a single mushroom home and a smurflightful plot of land. Harvest your smurfberries. Build charming huts, special mushroom houses, and beautiful bridges. And decorate your village with colorful gardens, lights, flower chairs, hammocks and more!\n------------------------\nFEATURES\n\nFAMILY ADVENTURE - Build your very own Smurfs' village and create a new home for the Smurfs.\n\nPLAY WITH YOUR FAVORITE SMURFS - The entire Smurf Family is here! Papa Smurf, Smurfette, Lazy Smurf, Baby Smurf, Handy Smurf, and Jokey Smurf.\n\nHARVEST SMURFBERRIES - Use in-app purchase to speed up the growth of your crops and your blue village\n\nSMURFY MINI-GAMES \u2013 While your village is growing, play multiple mini-games like: Greedy Smurf\u2019s Baking Game, Papa Smurf\u2019s Potion Mixing Game, Painter Smurf\u2019s Painting Game, Lazy Smurf's Fishin' Game and a new free Handy Smurf minigame to unlock additional bonuses.\n\nCONNECT WITH FRIENDS \u2013 Share your Smurfs Experience on Facebook and Game Center and send gifts to your friends' villages.\n\nPLAY OFFLINE - Manage your village anytime without having to connect to the internet.\n\n------------------------\nFollow us on Twitter: https:\/\/twitter.com\/smurfsgames\nFollow us on Facebook: https:\/\/www.facebook.com\/SmurfsVillage\nFollow us on YouTube: https:\/\/www.youtube.com\/bongfish",
