	"TBAppDescription": "2.1 Billion Gems & Magic Balls \nThe great and powerful summoner has broken into the king\u2019s castle and stolen the royal\ntreasure! You take the loot back to your lair, but the king has sounded the alarm and his endless\narmy of heroes is on the way to steal it back! It\u2019s time to ready your defences!\u00a0\n\nIn this idle TD game, you have to strategically place your towers and cast powerful spells to\ndefend against endless waves of the kingdom\u2019s mightiest heroes. Defend your stolen loot against\na variety of do-gooding heroes like the lowly peasant, axe-wielding lumberjack, ice mage and the\nelite king\u2019s knight \u2013 you don\u2019t want to mess with him!\n\nSUMMON MONSTERS & MINIONS TO FIGHT THE KING\u2019S ARMY!\nEarn magic orbs for defeating waves of armies - use them to power the summoner\u2019s portal to call\nforth a variety of monsters, creeps and minions to aid your defense. Recruit the common slimes,\nslimey and grimey, the rare and absurdly cute hellhound mocha, or Teddy \u2013 the epic teddy bear\nwith superhuman strength. With dozens of creatures to call to your defense, do you have what it\ntakes to defend against the heroes of the kingdom?\n\nCAST POWERFUL SPELLS. OBLITERATE THOSE WHO DARE TO ATTACK YOU\nIs the king stupid or has he forgotten you can shoot fireballs from your hands? In addition to your\nmisfit army of monsters, you can cast powerful spells to bring death to your enemies. Use\nfireballs, lightning, ice and more to power up your own monsters, rebuild defences and defend\nyour lair against the king\u2019s army.\u00a0\n\n-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --\nSUMMONER\u2019S GREED \u2013 HIGHLIGHTS\n-- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --\n\u2022 Dozens of monsters and towers to summon\n\u2022 Defend against endless waves of heroes and bosses\n\u2022 Each monster has their own unique abilities and secondary powers\n\u2022 Upgrade your towers to increase their effectiveness\n\u2022 Collect common, rare, epic and legendary monsters\n\u2022 Defeat a variety of enemy heroes, each with their own unique skills\n\u2022 Strategically place your towers to cause maximum damage\n\u2022 Use & upgrade spells to destroy, rebuild defences and buff your minions\u00a0\n\u2022 Original graphics & unique gameplay for a totally new kind of TD experience\n\nSUMMON. DEFEND. DESTROY. DOWNLOAD SUMMONER\u2019S GREED TODAY!",
