	"TBAppDescription": "2.1 Billion Coins & 65k Tickets\nRacing Fever is an addictive game for the fans of arcade racing and driving simulations.\n\nTHE ULTIMATE MULTIPLAYER RACE\nPick your favorite car and join the ultimate challenge!\nJoin 6 different rooms with massive prizes from Amateur to King\nRace head-to-head against your friends or challenge random players across the globe\n\nHIGH SPEED DRIVING\nRace at high speeds, drive against traffic and overtake cars!\nNothing is forbidden in Racing Fever, More Danger = More Coins!\n\nHIGH QUALITY GRAPHICS\nEnjoy the cutting edge 3D graphics with realistically created environments and amazingly detailed cars.\n\nTHE CAR OF YOUR DREAMS\nUpgrade your car to the limits, customize with paints, vinyls and rims.\nMake it better, faster, stronger and prettier.\n\nSLOW MOTION MODE\nDon't push your luck in sticky situations, slow time for easier manoeuvres. \nIt does not last forever but quickly refills.\n\nEXPLORE DIFFERENT THEMES\nTake a ride in Village, Desert, City, or have a snowy one in Winter. \nEach 4 environment are realistically created and highly detailed.\n\nGAME MODES FOR EVERY MOOD\nFeel the Fever in One Way and Two Way, rush a quick game in Time Attack or drive calmly in Free Ride.\n\nDRIVE IT YOUR WAY\nControl your car as you like.\nChoose Steering Wheel, Buttons, Gyro or even Joystick.\n\nMULTIPLE CAMERA ANGLES\nRace through traffic with Top or Back camera, or just dive into the action with Hood camera.\nEach camera angle offers a unique driving experience.\n\nLANGUAGE SUPPORT\nAvailable in 23 different languages and more soon!\n\nBONUSES\nEnter time limited quests to win big prizes!\nGet your daily bonus every day, multiply your bonuses with every consecutive visit. \nDon't forget to visit mini game too!\n\nSHARE & COMPETE\nExchange keys with friends and win a brand new car!\nCompare scores on leaderboards with friends and drivers all around the world.\n\n\n\nKEY FEATURES\n- Stunning 3D graphics\n- Smooth and realistic driving\n- 4 detailed environments: Village, Desert, City, Winter\n- 4 game modes: One Way, Two Way, Time Attack, Free Ride\n- 10 different cars (new cars on the way!)\n- Upgradeable Speed, Acceleration, Handling, Braking options\n- Customizable Paints, Rims, Vinyls\n- Rich traffic: Trucks, Buses, Vans, Pickups, SUVs & etc.\n- High, Medium and Low Graphic options\n- Time limited Quests & Bonus Game\n- Online Leaderboards and Achievements\n\nIn our game we have the following subscription offer:\n\nWeekly VIP Access subscription price is $12.99 after 3-day free trial which unlocks 3 VIP Cars and removes all ads. Also the subscription provides 50.000 coins and 5 tickets on a daily basis.\n\nPayment will be charged to your iTunes Account at confirmation of purchase.\nSubscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period.\nAccount will be charged for renewal within 24-hours prior to the end of the current period, and identify the cost of the renewal.\nSubscriptions may be managed by the user and auto-renewal may be turned off by going to the user\u2019s Account Settings after purchase.\n\nAny unused portion of a free trial period, if offered, will be forfeited when the user purchases a subscription to that publication, where applicable.\nYou can turn off the auto-renew for the subscription whenever you want in the settings if your iTunes account. Check https:\/\/support.apple.com\/HT202039.\n\nAfter your subscription expires, you will no longer be able to use vip cars.\nIf you have any questions or comments, feel free to contact us at support@gameguru.mobi\n\nPrivacy Policy: http:\/\/www.gameguru.mobi.com\/privacy.php\nTerms of Use: http:\/\/www.gameguru.mobi.com\/tos.php",
