	"TBAppDescription": "2.1 Billion Gems\nThe popular CCG meets Tower Defense game that has 1M+ downloads worldwide! Challenge your strategy in 500+ FREE levels! Fantastic Comic-Style Art, Over 90+ Collectible Cards, Epic Daily Quests & Weekly Tournaments, Customize Your Own Hero, and Hire Your Friends to Ally with You! \n\nCommand your troops and loot your way through hundreds of levels of card game wars and build your very own army in this epic CCG. Combine hundreds of items to create bigger, better and badder towers. Featuring hundreds of awesome tower defense levels, have you got what it takes to defend your kingdom from the Crazy Kings? Save the world in this popular TD adventure!\n\n\n|| CRAZY KINGS || GAME FEATURES || \n\n\u2022 500+ FREE LEVELS TO CHALLENGE YOUR STRATEGY\nHundreds of awesome levels set across snowy tundra, arid desert, rolling hills and more!\n\n\u2022 90+ COLLECTIBLE CARDS - TOWER DEFENSE CCG \nGet hooked with brain-busting strategy and super-addictive card collecting gameplay fun!\n\n\u2022 7 ESSENTIAL TOWERS & 12+ SPECIALIZED TOWERS \nEvery tower has varying ranges for attacks and unique abilities! Upgrade to defend!\n\n\u2022 18 DIVERSE SPELL ABILITIES AT YOUR COMMAND\nFrom powerful summons, to hero-healing charms, customize your awesome deck to battle!\n\n\u2022 30+ EQUIPMENT TO CUSTOMIZE YOUR OWN AVATAR\nFrom Helmet, Armor, Shield, Boots, Accessory to Weapon, YOUR choice will decide your avatar's abilities, such as attack damage, movement speed, defence and even health regeneration! \n\n\u2022 UPGRADE 20+ UNIQUE HEROES TO ALLY WITH YOU\nWin new items with every victory, and make your hero the biggest and badest!\n\n\u2022 OVER 100+ BADDIES TO BASH & BOSS FIGHTS\nFight dozens of enemy types, from Minotaurs, to Undead and even feathered fiends!\n\n\u2022 BUILD AND UPGRADE YOUR CARDS\nLevel up your battle deck from everyday defenses, right up to epic giant dragons!\n\n\u2022 FANTASTIC EYE-CATCHING COMIC-STYLE ART DESIGN\nThe wink-nudge charm visual experience you\u2019ll come back for more!\n\n\u2022 WIN PRIZES IN QUESTS AND TOURNAMENTS\nJoin millions in daily battles and weekly tournaments for awesome rewards & endless fun!\n\n***********************************************\n\nLove Crazy Kings? \nStay up to date with the latest events and best TD games free strategies on the Crazy Kings Facebook page & wiki:\n- https:\/\/www.facebook.com\/CrazyKingsGame\/\n- http:\/\/crazykings.wikia.com\/wiki\/Crazy_Kings_Wiki\n\n***********************************************\n\n+ Crazy Kings is free to download and play tower defense game. Nevertheless, it also allows you to purchase some virtual game items with real money. You could disable in-app purchases in your device\u2019s settings.\n\n++ You may require an Internet connection to play Crazy Kings Adventure and access its social features. Crazy Kings may also contain advertising ads.",
