	"TBAppDescription": "2.1 Billion Coins & Island Unlocked\nLittle Rescue Machine is a Hilarious Physics Sandbox Game, players build little robots and rescue tiny people in the End of World.\n\nThe game is about building a useful robots but easily broken into pieces to rescue little people from disasters. \n\nUnleash your creativity and inspiration to create your own Hilarious Machines and show to your friends!\n\n- Added a new Theme Park Level with Ferris Wheel, Pirate Ship, Drop Tower, Air Racer, Railway System, Train and stuffs!\n- Over 100+ Items to design and decorate your machine!\n- Over 45+ Missions to complete!\n- Save \/ Load your machine and show to your friends!\n- Map Editor to design your own world, including designing a Theme-Park Train-Railway system!\n- Lucky Draw chest to win useful and special Rare Items!\n- Unlock achievements and submit your leadership score to compete with Global Creators!\n\nDownload and Play Today!\n\n------------------------------\nGameplay Features\n------------------------------\n\n[* Build and Controllers *]\nEasy build with cubic items with setting up controllers for each items to control in real time!\n\n[* Theme Park Facilities *]\nDesign your own Theme Park Facilities, and watch your Ferris Wheel spinning all day, OR have a ride inside a Pirate ship and swing to the sky!\n\n[* Railway Train Simulator *]\nBuild your own Railway tracks and deploy a Train, watch your train simulation goes along your designed tracks!\n\n[*Load \/ Save*]\nPlayer could also save his creation \/ design in the game, and is provided with 5 save slots. He then could load his designed machine to challenge other levels.\n\n[*Map Editor*]\nOnce player beat a new level, the terrains and victims in that particular level will be unlocked and could be used in map editing. Player can design their own levels and challenge with other friends. \n\n[*Achievements & Leaderboard*]\nAchievements waiting to be unlocked in game.\nLeaderboard to challenge with global friends and show who is the REAL HERO!\n\nEmail : danielhdo@msn.com\nFacebook : https:\/\/facebook.com\/danielhdo\nTwitter : @papaonn\nDevelopment Blog : https:\/\/papaonn.blogspot.com\/",
