	"TBAppDescription": "2.1 Billion Mana & 2.1 Billion Gems\nCount Mathula has stolen the mighty book of Math and Sorcery and now it's up to you to bring it back.\n\nTrain and improve your math skills with Math and Sorcery!\n\nBattle enemies and various bosses with math in this turn based math puzzler with RPG elements!\n\nWith addition, subtraction, multiplication, and division, solve the four basic math operations as fast as you can to increase your attack multiplier and cause maximum damage. Attack one or multiple enemies at once, it's up to you how hard the calculations become. \n\nExplore 4 exciting areas with gorgeous hand-crafted pixel art.\n\nAcquire new companions to help you along in your journey. Each companion will grant you a boost to one of your hero's attributes like health, attack and luck. Choose your companions wisely before going into battle!\n\nCore features:\n* 100+ challenging levels to beat.\n* Master various boss fights.\n* Unlock 15 companions.\n* Take up to 4 companions into a battle.\n* Collect battle loot to level up your companions.\n* Collect experience points (XP) to level up your hero.\n* Unlock achievements.\n* Compare your stats and progress with your friends.\n\nSupported in game languages:\n* English\n* French\n* German\n* Italian\n* Spanish\n* Portuguese",
