	"TBAppDescription": "20 Billion Bucks & 240000 Golden Bars\nIf you love exotic village to city building games, then you'll love the City Island 3 - Building Sim! Join over 25 million players and start playing this popular city builder game today! Start on an exotic island with some cash and gold and from there begin building a city. Just start with constructing one house, expand that to a village, then create a city and try to expand it to metropolis.\n\nIf you liked our previous sim games: City Island 1 & 2, you will definitely love our third citybuilder game! This time you will have your own archipelago to build your cities! \n\nYou can unlock a building and build it on an exotic tourist island paradise, on a vulcano island, a swamp, a desert and more! Really cool city building allows you to construct cities, villages, compounds or a metropolis. Build it as you like, but keep a close eye on balancing the amount of people, jobs, happiness points. Keep your citizens happy with beautiful decorations, earn pirate chests, and create jobs so you can earn money and gold from your happy citizens. \n\nPeople in your own city will provide quests and feedback on how well you are doing! Furthermore, you can decorate your village city by placing walking paths, rivers, railroads with trains, transport, parks and hundreds more fun and beautifully designed items. \nIf you like playing free-to-play citygames, building a city in City Island 3: Building Sim is your best choice!\n\n** FEATURES **\n- Easy to play building sim\n- Build and decorate beautiful islands of your own archipelago with more than 300 unique items, be creative!\n- Fun FREE to play tycoon game\n- Tablet support\n- HIGH QUALITY graphics\n- Intuitive gameplay with challenging tasks, rewards and achievements\n- Enjoy fun quests to help you create your own virtual paradise in this free-to-play citygame!\n- Currencies: gold and cash, pirate chests\n- Attract citizens with parks, trees, a railway with trains, boats, decorations and community buildings\n- Collect profit from your commercial buildings\n- Upgrade your city buildings\n- Help your citizens by building a city on this exotic island story\n- Unlock transport to new islands\n- Collect XP and level up to unlock a new building for construction\n- Collect dozens of REWARDS while playing\n- Expand your city to create more room for constructing more buildings, transport and progress your village to a metropolis with tall buildings\n- Speed up construction \/ upgrade time\n- Lots of adventure, pirate chests and quests to unlock\n- Expand your city over land and sea\n- Many hours of free fun",
