	"TBAppDescription": "2.1 Billion Coins\n***Get to the Choppa! Over 3 million downloads! ***\n\nDon't forget to try out the new SURVIVAL mode! Can you stay intact for more than 2 minutes while dodging missiles and debris falling from the sky?\n\nYou are Rick Guiver, a reckless coast guard rescue helicopter pilot. A terrible oilrig catastrophe has happened in the coast! Against your superiors' orders and better judgement you jump in your helicopter and fly to the danger zone! There's no time to lose, save as many people as you can!\n\nChoppa is a physics based arcade & action game with touch controls, awesome pixel art and 80s style rock music. Progress through randomly generated stages and save as many people as possible - just don't let your choppa explode or fall to the sea! Purchase new helicopters, upgrade armor, engines and rescue gear and complete challenging missions while aiming for the top score. Game Center leaderboards are supported.\n\nFeatures:\n* Simple and precise touch controls\n* Physics based flying simulation\n* Procedurally generated stages with tricky obstacles\n* Nostalgic 80s vibe with awesome rock music and explosions\n* Hand-made pixel-art graphics\n* Bunch of unlockable choppers\n* Lots of fun missions\n* Game Center Leaderboards & Achievements",
