	"TBAppDescription": "Character & Skill Level Max\nHelp Koko Kornelius, the mad and brave monkey to defend the wildlife from vicious tree-cutters! Team up a wide variety of heroic animals and create the ultimate wall of defense!\n\nFeatured worldwide by the App Store:\n\u25c6 Best Monkey Games, 2016\n\u25c6 Winner in Tower Defense Games, 2015\n\u25c6 Best New Game & Update, 2013-2017\n\nOVER 300 FUN & CHALLENGING LEVELS\nChoose your own path through this seemingly endless game in a quest to become the king of the hill! This addictive game will keep you entertained for hours on end with exciting gameplay and over 300 unique levels! If that\u2019s not enough - unlock survival mode!\n\nEXTRAORDINARY ANIMALS AND SKILLS\nDiscover and upgrade the Smashback Gorilla, Punchbag Panda, Banana Magnet and many more unique characters and skills in this wild adventure. All with there own special abilities!\n\nA WALK IN THE PARK? IT\u2019S A WAR IN THIS PARK!\nBattle lumberjack Gunslingers, Ninjas, Chainsawers and much more. This exhilarating tale isn\u2019t a walk in the park - each lumberjack presents you with a new threat and a challenge to overcome!\n\nMORE COOL FEATURES\n- The ultimate strategy and action-defense game, wrapped into one wild package!\n- Challenge your friends via Game Center on the endless Survival Mode!\n- Collect over 60 achievements as you advance through the game! Can you collect them all?\n- Colorful graphic and amusing animations!\n\nPRESS QUOTES\n\"Lumberwhack is perfect for quick sessions, long playthroughs, or anything in-between\u2026one of the most fun castle defense games I\u2019ve played: 8 out of 10.\" \u2013 TouchArcade.com\n\n\"Terrific fun\u2026makes the time pass quickly. With plenty of levels on offer\u2026Lumberwhack: Defend the Wild should keep many a tower defense fan happy. 4.5 out of 5.\" \u2013 148Apps.com\n\n\"You will find yourself missing stops on a train trying to fight off the waves of enemies, and not care one bit.\" \u2013 DevelopersAccomplice.com\n\n\"Makes for some fun action. The skills and upgrades are probably the best part of Lumberwhack. Tower defence fans should certainly give this a try.\" \u2013 iFanzine.com\n\n\"This is tower-defense gaming evolved: incorporating features of other titles in the genre and refining them into something addictively pure: 10 out of 10.\"  \u2013 Noobsource.com\n\nFEEDBACK\nmail@kolossinteractive.com\n\nFollow on twitter.com\/KolossInteract\nFind on facebook.com\/KolossInteractive\nVisit at www.kolossinteractive.com",
