	"TBAppDescription": "21 Billion Bucks & 4 Million Golden Bars\nBattle the dead in this full movement, action packed, first person shooter (FPS). \n\nThe war against the dead has begun. Dead in the Box is a pivotal military operation to secure a zombie-infested city. You are a member of an elite military team that will blast through the dead until the zombies are annihilated, and the city is secure. You will carry out missions to defend assets, gather supplies, provide sniper support and above all, hunt and kill the zombies. \n\nIn this thrilling zombie shooter, you are armed with guns and melee weapons, tech, and armor, to help you survive the hordes of dead swarming this city. To become the ultimate zombie destroyer, you will need all of your tactical training and military skills to fight the dead in 7 unique environments. \n\nCustomize your equipment and weapons to play any style you want. Hunt the dead as a heavy machine gunner, a stealth zombie sniper, a super fast ninja, a machete zombie hunter, an axe murderer, a samurai zombie fighter, and more.\n\nIf you are tired of standing in one place shooting at waves of zombies, then this is the game for you. Dead in the Box is a free-movement first person shooter (FPS). \n\nKILLER FEATURES:\n7 large locations. Each map presents unique challenges, and requires different tactical strategies. Choose between easy, hard, or killer missions.\n6 Modes of Gameplay: Sniper, Defend, Gather, Survival, Attack, and Boss Battles. \nMany Zombie Types: Shufflers, Fast movers, Spitters, Smoking Zombies, Fire Zombies, Rage Zombies, Armored Zombies, Exploding Zombies, Bosses and more.\n25 modern guns: Small guns, sniper rifles, shotguns, long guns, and heavy machine guns.\nMelee weapons: Wrench, cleaver, machete, bloody axe, zombie bat, deadly katana, and the awesome King Sword. \nArmor and shoes to protect you and help you outrun the zombies on your missions.\nPowerful equipment and Boosters: Grenades, land mines, slow motion device, medkits and power ups.\nControls: Autofire for the casual gamer or manual shooting for the FPS gamer. 180 degree turn button for quick reaction. Virtual analog stick for full movement. \n\nLANGUAGES: English, \ud55c\uad6d\uc5b4, \u0420\u0443\u0441\u0441\u043a\u0438\u0439, \u65e5\u672c\u8a9e, \u4e2d\u6587\u7e41\u9ad4, Deutsch, Bahasa Indonesia, Malay, \u0e44\u0e17\u0e22, Portugu\u00eas, Fran\u00e7ais, Italiano, Espa\u00f1ol.",
