	"TBAppDescription": "Ads Removed\nSpawnRunner\n\nYou are a lonely tourist on a fantasy world. There're many obstacles standing on your way. You have to avoid them by spliting or merging yourself. Keep at least one clone alive. Try your best to beat your friends score via Game Center and to unlock interesting characters.\n\nHow to Play:\n- SpawnRunner is an endless 3 lanes running game. You have to avoid obstacles on the way.\n- Tap will split your character if there's only one clone and fuse them if there're 2 clones.\n\nFeature:\n- Blissful graphic and music.\n- Interesting characters to unlock.\n- 2 Game Modes: Normal and Survival.\n- Share your score with friends via Game Center, Facebook and Twitter.",
