	"TBAppDescription": "990 Million Gold Coins  990 Million Gems \nCrashing Season an action-packed runner game where animals go on the rampage! The game has a physics based 3D world in which your mission is to survive and crash into waves of enemies, fight mean bosses and complete goals!\n\nFeatures:\n\u25cf Use skill to conquer various worlds facing waves of enemies\n\u25cf Use various animal characters! Play as a Fox, Polar Bear, Goat or even a Wolverine! 15 fun characters with more on the way!\n\u25cf Unlock, use and upgrade epic boosts, power-ups and little helpers for even more Crashing Action!\n\u25cf Customize your characters with awesome accessories\n\u25cf Compete against other players on global high score rankings\n\u25cf Challenge other users in multiplayer gameplay for extra rewards\n\nThe Evil megacorporation NGS and their bosses enslaved the animals in their quest for world dominance. Now it is time for epic revenge! Use super powers & grow your characters and take over the world yourself while beating any enemy that stands in your way. It\u2019s CRASHING SEASON - The world\u2019s first closed area action runner game with award winning low poly styled 3D graphics and artwork!\n\nCrashing Season is completely free to download and play, but there are optional in-app purchases available. Either way, get ready to help the animals in their quest for world dominance!\n\nFollow us:\nhttps:\/\/www.facebook.com\/CrashingSeason\nhttps:\/\/www.twitter.com\/CrashingSeason\nhttps:\/\/www.instagram.com\/crashingseason\/\n\nWebsite:\nhttp:\/\/crashingseason.com\n\nJoin our community forum:\nhttp:\/\/koukoi.com\/community\/forum\/\n\nThis game may include:\n\u25cf Direct links to social networking and media websites that are intended for an audience over the age of 13\n\u25cf Direct links to the Internet that can take players away from the game with the potential to browse to any web page\n\u25cf Advertising of Koukoi Games products and also products from third parties\n\nThis game may require Internet connectivity and subsequent data transfer charges may apply.\n\nSupport:\nAre you having problems? Contact us support@koukoi.com or find help from our community forum http:\/\/koukoi.com\/community\/forum\/ (English only).\n\nPrivacy Policy:\nhttp:\/\/koukoi.com\/policies\/PrivacyPolicy.html\n\nTerms of Service:\nhttp:\/\/koukoi.com\/policies\/TermsOfService.html",
